--            WITH x (
--                      id_addr_obj_new
--                     ,id_addr_obj_old 
--           )      
--             AS (
--                    SELECT DISTINCT id_lead, id_addr_obj OVER (PARTITION BY id_lead) 
--                      FROM gar_fias_pcg_load.f_addr_area_show_data (
--                                                          p_fias_guid := '40ae04e3-9a69-44ea-8bd7-6c6f08e1a4ca'
--                                                         ,p_qty := 1
--                   ) where (id_lead <> id_addr_obj
--                )
--          select * FRom x
--                  SELECT z1.object_guid  AS fias_guid_new 
--                        ,z2.object_guid  AS fias_guid_old 
--                        ,z1.obj_level 
--                        ,current_date
--                  FROM x
--                    INNER JOIN gar_fias.as_addr_obj z1 ON (z1.object_id = x.id_addr_obj_new)
--                   left JOIN gar_fias.as_addr_obj z2 ON (z2.object_id = x.id_addr_obj_old) 
--                 WHERE ( (z1.object_guid IN ('5470bf73-8900-4e4b-935c-d2724ea3ca3e', 'e4404769-507d-488e-9211-390769a182a0', '884e0862-aa3b-463d-9ac3-06bc2b1fdab8')) --OR

explain analyze
       WITH z (    id_addr_obj
                  ,id_addr_parent
                  ,nm_addr_obj
                  ,addr_obj_type_id
                  ,date_create
                  ,id_lead
                  ,obj_level
         ) AS 
           (
             -- Выбираю записи, принадлежание обрабатываемой дате.
             SELECT  x.id_addr_obj
                    ,x.id_addr_parent
                    ,upper(x.nm_addr_obj)
                    ,x.addr_obj_type_id
                    ,x.date_create
                    ,x.id_lead
                    ,x.obj_level
                   
                  FROM gar_fias.gap_adr_area x WHERE (x.date_create = current_date) AND (X.FIAS_guid IN ('5470bf73-8900-4e4b-935c-d2724ea3ca3e', 'e4404769-507d-488e-9211-390769a182a0', '884e0862-aa3b-463d-9ac3-06bc2b1fdab8'))
              ORDER BY  x.nm_addr_obj, x.id_addr_obj DESC     
            )
            
              SELECT DISTINCT ON (a.fias_guid, b.fias_guid)
                     a.fias_guid AS fias_guid_new
                   , b.fias_guid AS fias_guid_old 
                  -- , z.id_lead
                --   , z.id_addr_parent  
                   , z.nm_addr_obj 
                   , z.addr_obj_type_id              
               --    , z.id_addr_obj AS id_addr_obj_new
               --    , b.id_addr_obj AS id_addr_obj_old
                   , z.obj_level
              FROM z
                JOIN gar_fias.gap_adr_area a ON (z.id_lead = a.id_addr_obj) AND  (z.date_create = a.date_create)
                JOIN gar_fias.gap_adr_area b ON (z.id_lead <> b.id_addr_obj) AND (b.date_create = z.date_create) AND
                                                (z.id_addr_parent = b.id_addr_parent)  AND
                                                (z.nm_addr_obj = upper(b.nm_addr_obj)) AND
                                                (z.addr_obj_type_id = b.addr_obj_type_id) 
                

                ;

